import React from 'react';
import { Switch, Route } from 'react-router-dom';

import LandingPage from './landingpage';
import Projects from './projects';
import Posti from './posti';
import HackathonGOC from './hackathonGOC';
import HackathonAD from './hackathonAD';
import HackathonWK from './hackathonWK';
import HackathonEU from './hackathonEU';
import BetsFriends from './betsFriends';
import Vredestein from './vredestein';
import PCdesign from './pcdesign';
import PCtechnical from './pctechnical';
import PCwork from './pcwork';
import IandE from './iande';
import Tekla from './tekla';

const Main = () => (
  <Switch>
    <Route exact path="/home/" component={LandingPage}/>
    <Route path="/home/projects" component={Projects} />
    <Route path="/home/posti" component={Posti} />
    <Route path="/home/hackathonGOC" component={HackathonGOC} />
    <Route path="/home/hackathonAD" component={HackathonAD} />
    <Route path="/home/hackathonWK" component={HackathonWK} />
    <Route path="/home/hackathonEU" component={HackathonEU} />
    <Route path="/home/betsFriends" component={BetsFriends} />
    <Route path="/home/vredestein" component={Vredestein} />
    <Route path="/home/pcdesign" component={PCdesign} />
    <Route path="/home/pctechnical" component={PCtechnical} />
    <Route path="/home/pcwork" component={PCwork} />
    <Route path="/home/tekla" component={Tekla} />
    <Route path="/home/iande" component={IandE} />

  </Switch>
)

export default Main;
